profile:
“Quality over Quantity”&nbsp;
When choosing Three Steps Drywall inc.  you will not just get another dry walling contractor, you’re getting a family of professional craftsmen that care about the quality of their work. Since 2005 we have been providing homeowners and businesses across Ottawa and  its surrounding areas a traditional craftsmanship approach to their dry walling needs.
&nbsp;
Quality over Quantity&nbsp;
At Three Steps Drywall inc. we take pride in our craft and we treat every job as if it were our own home. We only use reliable materials for each job to ensure the durability of your construction needs. We don’t just do the job right, but make sure that we treat the customer right as well.
&nbsp;
We provide drywall, taping, sanding services in Ottawa and its surrounding areas such as Kanata, Carleton, Richmond, Nepean, Orleans, Osgoode, Kemptville, Barrhaven, etc…
Your drywall is installed from scratch at start and deliver whole at the end to ensure a high quality finish.

 &nbsp;
Craftsmen you can trust
 
&nbsp;
Professional drywall contractor&nbsp;
High quality materials&nbsp;
Prefill of gaps and imperfections with Durabond 90″&nbsp;
Projects start and finish on time&nbsp;
All work is checked to reduce errors&nbsp;
We clean up after ourselves when the job is complete&nbsp;
DRYWALL INSTALLATION&nbsp;
Our professional crew will skillfully and efficiently measure, order and install your 8′,10′ or 12′ ft x 4′ or 4’6″ x 1/2 or 5/8 drywall/gypsum boards. Experience, professional installers reduce your time and costs on site by reducing high or pop screw heads, wasted material, minimize seams, specify deliver of boards by varying sizes to be delivered to multiple locations within a project.
&nbsp;

DRYWALL REPAIRS&nbsp;
We repair drywall and plaster so as to match the characteristics of any existing walls.  This is critical in general repairs or home extensions. Our service is guaranteed, as we strive for and deliver the highest possible quality finish.
&nbsp;

DRYWALL TAPING&nbsp;
As professional tapers, we apply a thin coat of compound with the taping process, saving the contractor time, material and unnecessary sanding. Best results are achieved with three coats of compound.  As a cost savings measure two coats maybe preferred in areas such as the garage and occasionally the basement, based on the limitations of the project.
&nbsp;

PRIME CHECK&nbsp;
After the application of primer we revisit the site, to verify absolute customer satisfaction. This is call the post-Prime check.  If necessary any touch-ups will be completed at our expense.  Three Steps Drywall Inc. guarantees satisfaction.
&nbsp;

PLASTERING & CROWN MOULDING&nbsp;
We do Plastering, level 5 finish and custom build crown mouldings or match your existing ones for a perfect transformation.
&nbsp;

DRYWALL SANDING&nbsp;
Our sanding crew will smooth away any imperfections or rough edges. Our staff using light testing techniques to ensure the finest results.  Sanding tools are selected based on the area to be sanded.  Corners and delicate areas maybe sponge sanded for best results. For more information contact us at info@threestepsdrywall.com
&nbsp;

STIPPLE REMOVAL&nbsp;
We can remove Popcorn Ceilings or (Stipple) and make the surface flat again. With years of experience there is no Stipple surface we can’t make smooth and ready for paint.&nbsp;

&nbsp;

